import React from 'react'
import "./Navbar.css";
 const Navbar = () => {
  return (
    <div className='nav'>
      <img className='nav_logo'
      src="https://o.remove.bg/downloads/8efd837b-3fcd-4089-8778-dacfa7cdf9aa/netflix-removebg-preview.png" 
      width={160} height={80}
      alt="netflix logo"/> 
    </div>
  )
}
export default Navbar;
